import { ADD_EXPENSE } from "../constants/action-type";

const initialState = {
  expenses: []
};

const expenseReducer = (state = initialState, action) => {
  // let expense
  switch (action.type) {
    case ADD_EXPENSE:
      expense = action.payload
      return { ...state, expense }
    default:
      return state;
  }
}
export default expenseReducer;
